import '../../App.css';
import { Container,Button,Row,Col } from "react-bootstrap";
import VCNavigation from '../../components/VCNavigation';

export default function VCDashboard(){

    return(
        <div>
            <VCNavigation />
        <Container style={{marginLeft:100}} >
  <Row>
    
    <h1>VC Dashboard</h1>
  </Row>
</Container>
</div>
)}
